import './index.css'

const CourseTimelineCard = props => {
  const {courseDetails} = props
  const {courseTitle, description, tagsList} = courseDetails

  return (
    <li className="course-list-item">
      <h1>{courseTitle}</h1>
      <p>{description}</p>
      <ul>
        {tagsList.map(each => (
          <li key={each.id}>{each.name}</li>
        ))}
      </ul>
    </li>
  )
}

export default CourseTimelineCard
